I have a .Net Core API that is able to evaluate locally. However, when deployed to Azure an error occurs when instantiating an `InferenceSession`.

I have a client application that sends a file name and `byte[]` content of the ONNX file to the Azure app service - .Net Core API. The service internally writes the ONNX model supplied to Azure local app data using the code below which works without errors.

```
public string Write(string name, byte[] model)
        {
            var localAppData = Environment.GetFolderPath(Environment.SpecialFolder.LocalApplicationData);

            var infEnginePath = Path.Combine(localAppData, "InferenceEngine", "Models");

            Directory.CreateDirectory(infEnginePath);

            var modelPath = Path.Combine(infEnginePath, $"{name}.onnx");
            File.WriteAllBytes(modelPath, model);

            return modelPath;
        }
```

Using the `modelPath` returned in the method above the code below throws an error:

`var session = new InferenceSession(modelPath);`

An error occurs:

```
Exception thrown: 'System.AccessViolationException' in Microsoft.ML.OnnxRuntime.dll
An unhandled exception of type 'System.AccessViolationException' occurred in Microsoft.ML.OnnxRuntime.dll
Attempted to read or write protected memory. This is often an indication that other memory is corrupt.
```

System information

**OS Platform and Distribution (e.g., Linux Ubuntu 16.04)**: Azure App Service (latest Windows server OS perhaps).
**ONNX Runtime installed from (source or binary)**:binary - Nuget
**ONNX Runtime version**:0.4.0
Visual Studio version (if applicable): N/A
-.NET Core 2.2

**Describe the bug**
On a multi-GPU system, if a model session is created on GPUs other than GPU0 (i.e. GPU1), then "alloc failed" error will be thrown when running the model. The issue arise on [densenet](https://gallery.azure.ai/Model/DenseNet-121-1-2-2) and [inception](https://gallery.azure.ai/Model/Inception-v1-1-2-3), I scoped it down to a simple model that only have "concat" op. So the implementation of "concat" seems to be what causes the issue, but there might be more causes.

**Urgency**
none

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): 18.04
- ONNX Runtime installed from (source or binary): source
- ONNX Runtime version: rel-0.5.0
- Python version: 2.7
- Visual Studio version (if applicable):
- GCC/Compiler version (if compiling from source):
- CUDA/cuDNN version: gcc (Ubuntu 7.4.0-1ubuntu1~18.04.1) 7.4.0
- GPU model and memory: Tesla P100 / 16280MiB

**To Reproduce**
Describe steps/code to reproduce the behavior:

1. Compile the following code snippet `gcc -std=c++11 c_api_sample.cc -o ort_c_api -lonnxruntime -lstdc++ -lpthread`
2. copy the [simple_concat model](https://drive.google.com/file/d/1VEup87aipaFwocSQ-p7dQ6NXUJM0mMi3/view?usp=sharing) to pwd with name "model.onnx". Or you can use the densenet / inception model mentioned above
3. `./ort_c_api`
<details><summary>c_api_sample.cc</summary><p>

```C++
#include <assert.h>
#include <onnxruntime/cuda_provider_factory.h>
#include <onnxruntime/onnxruntime_c_api.h>
#include <stdio.h>
#include <stdlib.h>
#include <iostream>
#include <vector>
#include <thread>
#include <future>

//*****************************************************************************
// helper function to check for status
#define CHECK_STATUS(expr)                               \
  {                                                      \
    OrtStatus* onnx_status = (expr);                     \
    if (onnx_status != NULL) {                           \
      const char* msg = OrtGetErrorMessage(onnx_status); \
      fprintf(stderr, "%s\n", msg);                      \
      OrtReleaseStatus(onnx_status);                     \
      exit(1);                                           \
    }                                                    \
  }

std::string DimsToString(const std::vector<int64_t>& dims)
{
  std::string res = "[";
  for (const auto& dim : dims) {
    res += std::to_string(dim);
    res += ",";
  }
  res.back() = ']';
  return res;
}

struct TensorInfo {
  TensorInfo(
      const char* name, const ONNXTensorElementDataType& type,
      const std::vector<int64_t>& dims)
   : name_(name), type_(type), dims_(dims)
  {
  }

  const char* name_;
  ONNXTensorElementDataType type_;
  std::vector<int64_t> dims_;
};

void CreateSession(
  const char* model_path, const int device_id, OrtEnv* env,
  OrtSessionOptions* session_options, OrtSession** session)
{
  // To deploy on different device, need to set provider on cloned option
  // as you can remove a execution provider once it is appended
  OrtSessionOptions* context_options;
  CHECK_STATUS(OrtCloneSessionOptions(session_options, &context_options));
  std::unique_ptr<OrtSessionOptions, decltype(&OrtReleaseSessionOptions)>
      options_wrapper(context_options, OrtReleaseSessionOptions);

  // Use CUDA, device 0. CPU if -1
  if (device_id >= 0) {
    CHECK_STATUS(OrtSessionOptionsAppendExecutionProvider_CUDA(context_options, device_id));
    std::cout << "deploy on GPU " << device_id << std::endl;
  } else {
    std::cout << "deploy on CPU" << std::endl;
  }
  
  CHECK_STATUS(OrtCreateSession(env, model_path, context_options, session));
}

std::vector<TensorInfo> GetIOTensors(OrtSession* session, bool is_input, bool print_info = true)
{
  std::vector<TensorInfo> res;

  OrtAllocator* allocator;
  CHECK_STATUS(OrtCreateDefaultAllocator(&allocator));
  std::unique_ptr<OrtAllocator, decltype(&OrtReleaseAllocator)>
      allocator_wrapper(allocator, OrtReleaseAllocator);

  // print number of model input nodes
  size_t num_nodes;
  if (is_input) {
    CHECK_STATUS(OrtSessionGetInputCount(session, &num_nodes));
  } else {
    CHECK_STATUS(OrtSessionGetOutputCount(session, &num_nodes));
  }

  // iterate over all input nodes
  for (size_t i = 0; i < num_nodes; i++) {
    OrtTypeInfo* typeinfo;
    if (is_input) {
      CHECK_STATUS(OrtSessionGetInputTypeInfo(session, i, &typeinfo));
    } else {
      CHECK_STATUS(OrtSessionGetOutputTypeInfo(session, i, &typeinfo));
    }
    std::unique_ptr<OrtTypeInfo, decltype(&OrtReleaseTypeInfo)>
      type_info_wrapper(typeinfo, OrtReleaseTypeInfo);
      
    const OrtTensorTypeAndShapeInfo* tensor_info;

    // node names
    char* tensor_name;
    if (is_input) {
      CHECK_STATUS(OrtSessionGetInputName(session, i, allocator, &tensor_name));
    } else {
      CHECK_STATUS(OrtSessionGetOutputName(session, i, allocator, &tensor_name));
    }
    
    // node types
    ONNXTensorElementDataType type;
    CHECK_STATUS(OrtCastTypeInfoToTensorInfo(typeinfo, &tensor_info));
    CHECK_STATUS(OrtGetTensorElementType(tensor_info, &type));

    // shapes/dims
    size_t num_dims;
    CHECK_STATUS(OrtGetDimensionsCount(tensor_info, &num_dims));
    std::vector<int64_t> dims(num_dims);
    CHECK_STATUS(OrtGetDimensions(tensor_info, (int64_t*)dims.data(), num_dims));

    res.emplace_back(tensor_name, type, dims);
  }

  if (print_info) {
    std::cout << "Number of tensors = " << num_nodes << std::endl;
    for (size_t idx = 0; idx < res.size(); idx++) {
      std::cout << "Tensor " << idx << ":" << std::endl
                << "    name: " << res[idx].name_ << std::endl
                << "    type: " << res[idx].type_ << std::endl
                << "    dims: " << DimsToString(res[idx].dims_)
                << std::endl;
    }
  }
  return res;
}

OrtValue*
CreateTensor(const TensorInfo& info)
{
  OrtAllocator* allocator;
  CHECK_STATUS(OrtCreateDefaultAllocator(&allocator));
  std::unique_ptr<OrtAllocator, decltype(&OrtReleaseAllocator)>
      allocator_wrapper(allocator, OrtReleaseAllocator);

  OrtValue* res = nullptr;
  CHECK_STATUS(OrtCreateTensorAsOrtValue(
    allocator, info.dims_.data(), info.dims_.size(), info.type_, &res));
  return res;
}

int
main(int argc, char* argv[])
{
  //===================== Factory Scope ======================
  // initialize  enviroment...one enviroment per process
  // enviroment maintains thread pools and other state info
  
  // [TODO] look into OrtCreateEnvWithCustomLogger()
  OrtEnv* env;
  CHECK_STATUS(OrtCreateEnv(ORT_LOGGING_LEVEL_WARNING, "test", &env));
  std::unique_ptr<OrtEnv, decltype(&OrtReleaseEnv)>
        env_wrapper(env, OrtReleaseEnv);

  //===================== Backend Scope ======================
  // session option is backend-wise as it also specified GPU device
  // but other session option can be set "globally", like const variables
  // defined in factory object and use it to set corresponding options
  // initialize session options if needed
  OrtSessionOptions* session_options;
  CHECK_STATUS(OrtCreateSessionOptions(&session_options));
  std::unique_ptr<OrtSessionOptions, decltype(&OrtReleaseSessionOptions)>
        options_wrapper(session_options, OrtReleaseSessionOptions);
  CHECK_STATUS(OrtSetSessionThreadPoolSize(session_options, 1));

  // disable graph optimization
  CHECK_STATUS(OrtSetSessionGraphOptimizationLevel(session_options, 0));

  //===================== Context Scope ======================
  // create multiple sessions and load models into memory
  std::vector<std::pair<const char*, int>> model_spec;
  {
    // deploy model on all devices
    // [TODO] argument option
    model_spec.emplace_back("model.onnx", -1);
    model_spec.emplace_back("model.onnx", 0);
    model_spec.emplace_back("model.onnx", 1);
  }

  std::vector<std::unique_ptr<OrtSession, decltype(&OrtReleaseSession)>> sessions;
  for (const auto path_device : model_spec) {
    OrtSession* session;
    CreateSession(
        path_device.first, path_device.second, env, session_options, &session);
    sessions.emplace_back(session, OrtReleaseSession);
  }

  //===================== Infer Scope ======================
  for (auto& session_wrapper : sessions) {
    auto session = session_wrapper.get();
    
    // print model input/output layer (node names, types, shape etc.)
    std::cout << "Input infos:" << std::endl;
    auto input_infos = GetIOTensors(session, true);

    std::cout << "Output infos:" << std::endl;
    auto output_infos = GetIOTensors(session, false);

    // Fill input tensors
    std::vector<const char*> input_names;
    std::vector<OrtValue*> input_tensors;
    for (auto input_info : input_infos) {
      if (input_info.type_ != ONNX_TENSOR_ELEMENT_DATA_TYPE_STRING) {
        input_names.emplace_back(input_info.name_);
        // [TODO] generate meaningful input so that output can be validated
        input_tensors.emplace_back(CreateTensor(input_info));
      } else {
        std::cout << "Inference with STRING input hasn't been implemented" << std::endl;
        exit(1);
      }
    }

    // Set output tensors to be retrieved
    std::vector<const char*> output_names;
    std::vector<OrtValue*> output_tensors;
    for (auto output_info : output_infos) {
      output_names.emplace_back(output_info.name_);
      output_tensors.emplace_back(nullptr);
    }

    // Run...
    CHECK_STATUS(OrtRun(
        session, NULL /* run options */, input_names.data(),
        (const OrtValue* const*)input_tensors.data(), input_tensors.size(),
        output_names.data(), output_names.size(), output_tensors.data()));
  }

  // Factory-wise
  
  return 0;
}
